import React from "react";
import homeView from "../imgs/homeView.svg";

export default function Welcome() {
  return (
    <div>
      <img
        src={homeView}
        style={{ float: "right", marginRight: "3em" }}
        alt="Home page image"
      />
    </div>
  );
}
